# Definition for a binary tree node.
import unittest
from typing import List

class SubstringWithConcatenationOfAllWords(unittest.TestCase):

    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        if len(s) == 0 or len(words) == 0 or len(words[0]) == 0:
            return []

        wordLength = len(words[0])
        wordsToCount = dict()
        for word in words:
            if word not in wordsToCount:
                wordsToCount[word] = 1
            else:
                wordsToCount[word] = wordsToCount[word] + 1

        indexToWords = dict()
        for startPos in range(len(s) - wordLength + 1):
            substring = s[startPos:startPos+wordLength]
            if substring in wordsToCount:
                indexToWords[startPos] = substring

        result = []
        for startPos in range(len(s)):
            if self.isConcatenation(s, wordLength, startPos, len(words), wordsToCount, indexToWords):
                result.append(startPos)

        return result

    def isConcatenation(self, s: str, wordLength: str, startPos: int, numToBeMatched: int, wordsToCount: dict, indexToWords: dict) -> bool:
        if numToBeMatched == 0:
            return True

        result = False
        if startPos in indexToWords:
            substring = s[startPos:startPos + wordLength]
            if substring in wordsToCount and wordsToCount[substring] > 0:
                wordsToCount[substring] = wordsToCount[substring] - 1
                result = self.isConcatenation(s, wordLength, startPos + wordLength, numToBeMatched - 1, wordsToCount, indexToWords)
                wordsToCount[substring] = wordsToCount[substring] + 1

        return result

    def test_EdgeCases(self):
        # Assumption, no duplicate of chars
        self.assertEqual(0, len(self.findSubstring("wordgoodgoodgoodbestword", ["word", "good", "best", "word"])))
        self.assertEqual(0, len(self.findSubstring("", ["a", "b", "c"])))
        self.assertEqual(3, len(self.findSubstring("abc", [""])))
        self.assertEqual(0, len(self.findSubstring("a", [])))

    def test_NormalCases(self):
        result = self.findSubstring("barfoothefoobarman", ["foo", "bar"])
        self.assertTrue(2, len(result))
        self.assertTrue(0 in result)
        self.assertTrue(9 in result)

    def test_RepeatedWords(self):
        result = self.findSubstring("wordgoodgoodgoodbestword", ["word", "good", "best", "good"])
        self.assertTrue(1, len(result))
        self.assertTrue(8 in result)

